
-- -----------------------------
-- Table structure for `accumulation`
-- -----------------------------
DROP TABLE IF EXISTS `accumulation`;
CREATE TABLE `accumulation` (
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `in_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '线下充值',
  `online_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '在线充值',
  `out_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '取款',
  `use_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '消费',
  `give` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '赠送',
  `debit` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '扣款',
  `winning` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '中奖',
  `refund` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '退款',
  `maid` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '返佣',
  `sign` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '签到',
  `luck` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '抽奖',
  `return` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '彩票返水',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '当时账户余额(变动之前的数据)',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '累加时间',
  KEY `user_id` (`user_id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户数据累加表';

-- -----------------------------
-- Records of `accumulation`
-- -----------------------------

-- -----------------------------
-- Table structure for `admin`
-- -----------------------------
DROP TABLE IF EXISTS `admin`;
CREATE TABLE `admin` (
  `uid` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `last_login_time` int(11) DEFAULT '0',
  `last_login_ip` varchar(255) DEFAULT '0',
  `type` tinyint(1) DEFAULT '0' COMMENT '暂时无效',
  `status` tinyint(1) DEFAULT '0',
  `session_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='管理员表';

-- -----------------------------
-- Records of `admin`
-- -----------------------------

-- -----------------------------
-- Table structure for `article`
-- -----------------------------
DROP TABLE IF EXISTS `article`;
CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat_id` tinyint(2) NOT NULL DEFAULT '0' COMMENT '文章分类id  1:游戏规则 2:优惠活动 3:公告 4:新闻',
  `title` varchar(25) NOT NULL DEFAULT '' COMMENT '标题',
  `brief` varchar(50) DEFAULT '' COMMENT '文章简介',
  `content` longtext NOT NULL COMMENT '内容',
  `other` varchar(50) DEFAULT NULL COMMENT '其他（游戏规则时，用来放游戏ID）',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '文章发布时间',
  PRIMARY KEY (`id`),
  KEY `cat_id` (`cat_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='新闻表';

-- -----------------------------
-- Records of `article`
-- -----------------------------

-- -----------------------------
-- Table structure for `article_category`
-- -----------------------------
DROP TABLE IF EXISTS `article_category`;
CREATE TABLE `article_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='新闻类别表';

-- -----------------------------
-- Records of `article_category`
-- -----------------------------

-- -----------------------------
-- Table structure for `bank_pay`
-- -----------------------------
DROP TABLE IF EXISTS `bank_pay`;
CREATE TABLE `bank_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) NOT NULL DEFAULT '' COMMENT '银行名称(简码)',
  `number` varchar(20) NOT NULL DEFAULT '' COMMENT '账户号',
  `user_name` varchar(10) NOT NULL DEFAULT '' COMMENT '账户姓名',
  `qr_code` varchar(255) DEFAULT '' COMMENT '二维码图片地址',
  `slogan` varchar(40) DEFAULT '' COMMENT '充值标语，不超过40个字',
  `explain` varchar(255) DEFAULT '' COMMENT '入款说明',
  `min` int(11) DEFAULT '0' COMMENT '最小充值金额，0不限制',
  `max` int(11) NOT NULL DEFAULT '0' COMMENT '最大充值金额，0不限制',
  `sort` int(2) NOT NULL DEFAULT '0' COMMENT '排序',
  `switch` int(1) NOT NULL DEFAULT '0' COMMENT '开关',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='公司入款表';

-- -----------------------------
-- Records of `bank_pay`
-- -----------------------------

-- -----------------------------
-- Table structure for `betting`
-- -----------------------------
DROP TABLE IF EXISTS `betting`;
CREATE TABLE `betting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `content` text NOT NULL COMMENT '下注内容',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '下注总金额',
  `expect` bigint(20) NOT NULL DEFAULT '0' COMMENT '期号',
  `type` int(3) NOT NULL DEFAULT '0' COMMENT '彩种编码',
  `win` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖金',
  `state` int(2) NOT NULL DEFAULT '0' COMMENT '0 未结算 1 已结束 2 已撤单 3 追号中',
  `other` varchar(50) DEFAULT NULL COMMENT '备用字段(28房间，港彩盘)',
  `explain` text COMMENT '说明使用字段',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '投注时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `expect` (`expect`),
  KEY `state` (`state`)
) ENGINE=InnoDB AUTO_INCREMENT=652 DEFAULT CHARSET=utf8 COMMENT='投注记录';

-- -----------------------------
-- Records of `betting`
-- -----------------------------

-- -----------------------------
-- Table structure for `betting_gen`
-- -----------------------------
DROP TABLE IF EXISTS `betting_gen`;
CREATE TABLE `betting_gen` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `betting_id` int(11) NOT NULL DEFAULT '0' COMMENT '投注表ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '跟单金额',
  `win` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖金',
  `main` int(1) NOT NULL DEFAULT '0' COMMENT '0为跟单，1为发起',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '跟单时间',
  PRIMARY KEY (`id`),
  KEY `betting_id` (`betting_id`),
  KEY `user_id` (`user_id`),
  KEY `main` (`main`)
) ENGINE=InnoDB AUTO_INCREMENT=153 DEFAULT CHARSET=utf8 COMMENT='合买跟单表';

-- -----------------------------
-- Records of `betting_gen`
-- -----------------------------

-- -----------------------------
-- Table structure for `betting_he`
-- -----------------------------
DROP TABLE IF EXISTS `betting_he`;
CREATE TABLE `betting_he` (
  `betting_id` int(11) NOT NULL DEFAULT '0' COMMENT '投注表id',
  `all` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '总金额',
  `buy` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已购买金额',
  `open` int(2) NOT NULL DEFAULT '0' COMMENT '投注内容是否公开 0: 公开 1:仅跟单人可见 2: 截止后公开 3:完全保密',
  `bd` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '保底多少',
  `tc` int(3) NOT NULL DEFAULT '0' COMMENT '中奖提成(%)',
  `explain` varchar(255) DEFAULT NULL COMMENT '发起合买得宣传语',
  `num` int(11) NOT NULL DEFAULT '0' COMMENT '点击查看次数',
  PRIMARY KEY (`betting_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='合买详情表';

-- -----------------------------
-- Records of `betting_he`
-- -----------------------------

-- -----------------------------
-- Table structure for `betting_zhui`
-- -----------------------------
DROP TABLE IF EXISTS `betting_zhui`;
CREATE TABLE `betting_zhui` (
  `betting_id` int(11) NOT NULL DEFAULT '0' COMMENT '投注表id',
  `expect` bigint(1) NOT NULL DEFAULT '0' COMMENT '追号期数',
  `stop` int(1) NOT NULL DEFAULT '0' COMMENT '中奖是否停止追号 0 不停止 1停止',
  `win` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '这一期的奖金',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  KEY `betting_id` (`betting_id`),
  KEY `expect` (`expect`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='追号表';

-- -----------------------------
-- Records of `betting_zhui`
-- -----------------------------

-- -----------------------------
-- Table structure for `capital_audit`
-- -----------------------------
DROP TABLE IF EXISTS `capital_audit`;
CREATE TABLE `capital_audit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `bank` varchar(20) NOT NULL DEFAULT '0' COMMENT '充值方式',
  `pay_account` char(100) DEFAULT NULL COMMENT '付款账号',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '金额',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0:充值 1:取款',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0:未处理1:成功2:拒绝',
  `remarks` varchar(50) DEFAULT NULL COMMENT '备注',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '提交时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='资金审核表';

-- -----------------------------
-- Records of `capital_audit`
-- -----------------------------

-- -----------------------------
-- Table structure for `capital_detail`
-- -----------------------------
DROP TABLE IF EXISTS `capital_detail`;
CREATE TABLE `capital_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '0:下注 1;提现 2:线下充值 3:中奖 4:扣款 5:赠送 6:退款 7:在线充值 8:返佣 9:签到 10:抽奖 11:返水 12:冻结资金 13:冻结返还 14:保底投注 15:系统充值',
  `explain` varchar(50) DEFAULT NULL COMMENT '说明',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '操作时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `type` (`type`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=1443 DEFAULT CHARSET=utf8 COMMENT='资金明细表';

-- -----------------------------
-- Records of `capital_detail`
-- -----------------------------
